import {ColorLensSharp} from '@mui/icons-material';
import {Grid, Paper, Typography} from '@mui/material';
import React from 'react';

type toDoProps = {title: string; color: string};

const Todo = ({title, color}: toDoProps) => {
   return (
      <Grid item>
         <Paper
            elevation={5}
            sx={{
               width: '15rem',
               height: '15rem',
               backgroundColor: color,
            }}
         >
            <Typography
               variant="h2"
               sx={{textAlign: 'center', marginBottom: '1rem'}}
            >
               {title}
            </Typography>
         </Paper>
      </Grid>
   );
};

export default Todo;
